import React from 'react';
import styled from 'styled-components';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination, Autoplay } from 'swiper';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';

const CanSlider = () => {
  return (
    <CanSliderBox>
      <Swiper
        slidesPerView={5}
        spaceBetween={30}
        navigation
        navigation={{
          nextEl: '.next',
          prevEl: '.prev',
        }}
        pagination={{
          clickable: true,
        }}
        modules={[Pagination, Autoplay, Navigation]}
        className='mySwiper'
        loop={true}
        autoplay={{
          delay: 2500,
          disableOnInteraction: false,
        }}
      >
        <SwiperSlide>
          <img src='./img/slide/can1.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slide/can2.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slide/can3.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slide/can4.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slide/can5.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slide/can6.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slide/can7.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slide/can8.jpg' alt='' />
        </SwiperSlide>
        <SwiperSlide>
          <img src='./img/slide/can9.jpg' alt='' />
        </SwiperSlide>
        <NavPrev />
        <NavNext />
      </Swiper>
    </CanSliderBox>
  );
};

export default CanSlider;

const CanSliderBox = styled.div`
  width: 1200px;
  height: auto;
  margin: 3rem auto;
  & .swiper-slide img {
    width: 150px;
  }
`;

const NavPrev = styled.button`
  background: url(./img/slide/prev.png) no-repeat center;
  width: 40px;
  height: 40px;
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  left: 50px;
  z-index: 5000;
`;

const NavNext = styled(NavPrev)`
  background: url(./img/slide/next.png) no-repeat center;
  left: auto;
  right: 50px;
`;
